mapper.select:
  select org_flow, training_spe_id, count(1) training_Count
from res_doctor
  where session_number = #{sessionNumber}
  and doctor_status_id = #{doctorStatusId}
  and training_spe_id in

      #{trainingSpeId}

  and org_flow = #{orgFlow}
  and record_status = 'Y'
  group by org_flow, training_spe_id
